import React, { Component } from "react";

class Main extends Component {
  render() {
    const main = (props) => {
      return (
        <h1 key={props.person.id}>
          Hello! My name is {props.person.name}. I am {props.person.age}. I am
          studying {props.person.skill}
        </h1>
      );
    };
  }
}

export default Main;
